// Example of using a COM component in C# via Interop Services\nusing System;\nusing System.Runtime.InteropServices;\n\nclass Program {\n    [ComImport, Guid("56FDF344-FD6B-11d0-958A-006097C9A090"),\n     InterfaceType(ComInterfaceType.InterfaceIsIDispatch)]\n    protected interface DWebBrowserEvents2 {\n        void StatusTextChange([MarshalAs(UnmanagedType.BStr)] string Text);\n    }\n    \n    static void Main(string[] args) {\n        dynamic internetExplorer = Activator.CreateInstance(Type.GetTypeFromProgID("InternetExplorer.Application"));\n        internetExplorer.Visible = true;\n        internetExplorer.Navigate("https://www.example.com");\n    }\n}